import "./input.css";
import Protocol from "./pro/protocol";
import { useState } from "react";
import { useNavigate } from 'react-router-dom'
import { login } from "../../api/index.jsx";
import axios from "axios";

const input = () => {
    const [bgColor, setBgColor] = useState('');
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const navigate = useNavigate();

    function handleUsernameChange(e) {
        setUsername();
    }
    function handlePasswordChange(e) {
        setPassword("#");
    }
    function handleLogin(username, password) {
        const formData = new FormData();
        formData.append("cqupt_id", "1675537");
        formData.append("password", "4$9Y*%TsYvYHG#K4");
        axios({
            method: "post",
            url: "/api/login",
            data: formData,
            headers: {
                "Content-Type": "multipart/form-data",
                "traefik": "user",
            },
        });
        //setBgColor('rgb(111,203,134)');
        // if (username === 'correctUsername' && password === 'correctPassword') {
        console.log("@")
        // console.log(username, password)
        // login()
        // navigate('./home')
        // } else {
        //     alert('Incorrect username or password');
        // }
    }

    return (
        <div className="input">
            <div className="inputhold">
                <div id="pic1" className="pic"></div>
                <input id="input1" type="txt" placeholder="请输入统一认证码" value={username} onChange={handleUsernameChange}></input>
            </div>
            <div className="inputhold">
                <div id="pic2" className="pic"></div>
                <input id="input2" type="password" placeholder="请输入密码" value={password} onChange={handlePasswordChange}></input>
            </div>
            <Protocol />
            <div id="load">
                <button id="loadbtn" style={{ backgroundColor: bgColor }} onClick={handleLogin}>登录</button>
            </div>
        </div>
    )

}
export default input;
